import "./Navbar.css";
import {Link} from "rea"

function Navbar() {
    return (
        <nav className="NavbarItems">
            <h1 className="navbar-logo">Pong</h1>
            <ul className="nav-menu">
                <li>
                    <Link>
                    <i><i class="fa-solid fa-house"></i></i>Home</Link>
                </li>
            </ul>
        </nav>
    );
}

export default Navbar;
